For example, if you have a table table_source in WGS84 (4326 SRID), then you can use this function as a Function Source: CREATE OR REPLACE FUNCTION function_zxy_query(z integer, x integer, y integer) RETURNS bytea AS $$
DECLARE mvt bytea;
BEGIN SELECT INTO mvt ST_AsMVT(tile, 'function_zxy_query', 4096, 'geom') FROM ( SELECT ST_AsMVTGeom( ST_Transform(ST_CurveToLine(geom), 3857), ST_TileEnvelope(z, x, y), 4096, 64, true) AS geom FROM table_source WHERE geom && ST_Transform(ST_TileEnvelope(z, x, y), 4326) ) as tile WHERE geom IS NOT NULL; RETURN mvt;
END
$$ LANGUAGE plpgsql IMMUTABLE STRICT PARALLEL SAFE;

